クレセント（三日月）断面のボディと独特なダイヤテールが生み出す、アグレッシブでミステリアスな泳ぎ。イザベラはデッドスローリトリーブでも激しいイラテックアクションを生み出し、ビッグトラウトを思わずリアクションバイトさせてしまいます。なお、フォーリング時に見せる、カクカクとした独特のトリックフォールアクションは、連日叩きぬかれたトラウトが思わず口を使ってしまう、妖しい魔力。こうしてイザベラは、フォーリング中のバイトも多発するため、リトリーブ、ポーズの一瞬も気が抜けないスプーンです。また、スプーンX同様、わずかなトゥイッチにも即応し、マジカルな動きでスレマスのバイとを誘発。管理釣り場のスーパーシークレット、イザベラが神秘のベールを脱ぎます。<hr>2.2g<style>
