「サラナ」の3つのコンセプト、それはSAltation（跳躍）、RUmmage（探索）、NAvigation（航行）です。<br><br> 　「サラナ」はボディ内の重心移動距離を可能な限り長くし、キャスティング時に発生する重力慣性を大きくさせています。この力はスレンダーなボディとあいまって、逆風時でも、横風を受けてもバランスを維持するように働き、狙ったポイントへ正確にキャストすることを可能にしました。<br><br> 　一見すれば飾りのようにも見える小さな背ビレは、飛行中の姿勢をより安定させると同時に、ファーストリトリーブの際に発生するローリング現象を適度にコントロールし、優れた直進安定性を与えるためのものです。<hr>タイプ　フローティング<hr>全長　９５ｍｍ<hr>重量　９．５ｇ<hr>重心移動機構搭載<hr>カルティバST-46フック採用<style>
