独自の左右非対称フォルムのサイドウェイトにより、ジャーク時の超ワイドなスライド性能と水平姿勢ヒラヒラフォール。スライドからフォールに移る「時間」にこだわり、生み出された「食わせの間」。さらに水平姿勢フォールから、バランスをシフトする二段フォールは、あらゆるフィッシュイーターに半ば強制的に捕食スィッチを入れるレベルに達しました。Ｆ８釣法に新次元「時間」を加えた「Ｆ４釣法」へ進化して、ルアーの五目釣りに新革命を巻き起こします！２０ｇ以上は、強いアクションで大型サイズを誘えるチューニングのため、フロントアシストを追加。<hr>40ｇ<hr>アシストフック標準装備<hr>テールフックにトレブルフック装備<style>
