スイムベイトの開発に長年携わり研究を積み重ねてきたVAGABOND(ヴァガボンド)では、日本の河川や湖沼に多く生息するベイトフィッシュのモチーフを模索してきた。国土面積の多くを山岳で占める日本のリザーバーの大半は川を堰き止めたダムと呼ばれる貯水池。また、規模の大小こそあるものの天然湖や沼には流入する河川と流出する河川が必ず存在する。日本のどの河川でも必ず生息するベイトフィッシュは、ハエ、カワムツ、オイカワなどのように細長く流れのある渓流や清流を泳ぐのに適した流線形をしている。日本のベイトフィッシュの生態、捕食活動、動きを丹念に飼育観察した結果、日本のフィールドにベストマッチするサイズとシルエットが決定した。<hr>●7匹入●3g<style>
